import { Component } from '@angular/core';
import { Disciplina } from 'src/app/models/Disciplina';
import { ToastrService } from 'ngx-toastr';
import { DisciplinaService } from 'src/app/services/disciplina.service';
import { CompetitorService } from 'src/app/services/competitor.service';
import { forkJoin, Observable } from 'rxjs';
import { map } from 'rxjs/operators';
import { of } from 'rxjs';

@Component({
  selector: 'app-mostrardisciplina',
  templateUrl: './mostrardisciplina.component.html',
  styleUrls: ['./mostrardisciplina.component.css']
})
export class MostrardisciplinaComponent {
  listaDisciplina : Disciplina[]=[];
  constructor(private disciplinaService:DisciplinaService,
    private toastr: ToastrService,
    private competitorService:CompetitorService){

  }
  ngOnInit(){
this.obtenerDisciplinas();
  }
  obtenerDisciplinas() {
    this.disciplinaService.getDiscipline().subscribe(
      response => {
        console.log(response);
        const data = response.data;
        if (Array.isArray(data)) {
          this.listaDisciplina = data;
          for (const iterator of this.listaDisciplina) {
            console.log(iterator.name);
          }
        } else {
          console.error('Los datos recibidos no son un array:', data);
        }
      },
      error => {
        console.log(error);
      }
    );
  }
  eliminarProducto(id: any) {
    this.disciplinaService.eliminarDiscipline(id).subscribe( response => {
      console.log(response);
        const data = response.data;
      console.log('El producto fue eliminado con exito');
        this.toastr.error('El producto fue eliminado con exito' ,'Producto Eliminado');
        this.obtenerDisciplinas();

    }, error => {
      console.log(error);
    })
  }
  obtenerIdsCompetidores(disciplina: Disciplina): Observable<string> {
    if (!disciplina.competitors || disciplina.competitors.length === 0) {
      return of('Sin competidores');
    }

    const observables = disciplina.competitors.map(competitorId => {
      console.log(competitorId)
      return this.competitorService.getCompetitorByIdO(competitorId).pipe(
        map(response => response.data.name)
        console
      );
    });

    return forkJoin(observables).pipe(
      map(names => names.join(', '))
    );
  }


}
